import React from "react";
import { Link, Switch, Route, Router } from "react-router-dom";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";
import Usuario from "./components/cadastroUsuario";
import Veiculo from "./components/cadastroVeiculo";
import Busca from "./components/buscaVeiculo";
import "./App.css";

function App() {
  return (
    // <Router>
    //   <Button href={Veiculo}>Cadastrar Veiculo</Button>
    //   <Button href={Usuario}>Cadastrar Usuario</Button>
    //   <Button href={Busca}>Buscar Veiculo</Button>
    //   <Link to={Usuario}>Usuario</Link>
    // </Router>

    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/usuario" component={Usuario} />
          <Route exact path="/veiculo" component={Veiculo} />
          <Route exact path="/busca" component={Busca} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
